import './App.css';
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';
import initial from './components/initial';
//Aca empezamos a codificar y pasar los componentes.
function App() {
  return (
    <div className="App">
      <h1>Henry Food</h1> 
      <Router>
        <Switch>
        <Route
        path='/'
        component={initial}
        />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
